begin
wwv_flow_api.create_authentication(
 p_id=>wwv_flow_api.id(56646627968283897)
,p_name=>'Application Express Authentication'
,p_scheme_type=>'NATIVE_APEX_ACCOUNTS'
,p_invalid_session_type=>'LOGIN'
,p_use_secure_cookie_yn=>'N'
,p_ras_mode=>0
);
wwv_flow_api.create_authentication(
 p_id=>wwv_flow_api.id(56712373220793739)
,p_name=>'Custom_Authentication'
,p_scheme_type=>'NATIVE_CUSTOM'
,p_attribute_03=>'customAuthentication'
,p_attribute_05=>'N'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'function customAuthentication(p_username in varchar2,',
'                              p_password in varchar2) return boolean',
'is',
'   v_userName        varchar(20) := upper(p_username);',
'   v_password        varchar2(1000) := p_password; ',
'   v_valuesToHash    apex_t_varchar2 := apex_t_varchar2(v_username, p_password);',
'   v_userCount       int;',
'   v_dbversion       int;',
'   -- Variables for holding passed values only',
'   vp_password       varchar2(1000);',
'   vp_user           varchar(20) := upper(:P101_USERNAME);',
'begin',
'  --Check for DB Version',
'  select substr(version,1,2) into v_dbversion       ',
'  from product_component_version ',
'  where Product like ''Oracle Database%'';',
'',
'',
'  if v_dbversion = 11 then',
'     EXECUTE IMMEDIATE ''select count(*) from DCSCAL_USERS where Username = :vp_user and Password = rawtohex(DBMS_CRYPTO.Hash (UTL_I18N.STRING_TO_RAW (concat(:vp_user,:vp_password), ''''AL32UTF8''''),3))''',
'     into v_userCount',
'     USING v_userName,v_userName,v_password;',
'  else ',
'    select count(*) ',
'    into v_userCount',
'    from DCS_USERS',
'    where Username = v_username',
'    and Password = apex_util.get_hash(v_valuesToHash,null);',
'  end if; ',
'',
'  -- Return true if v_userCount = 1 otherwise returns False',
'  return v_userCount = 1;',
'  ',
'end;'))
,p_invalid_session_type=>'LOGIN'
,p_use_secure_cookie_yn=>'N'
,p_ras_mode=>0
);
